INSERT INTO `site_content` VALUES (1,'welcome_to_goal_attainment_scaling','GSS is a method of measuring goal attainment over time, using a five-point scale to capture all possible outcomes for a given goal. GSS is a unique approach to goal setting, one that promotes success along a continuum rather than the traditional all-or-nothing success vs. failure model.  This methodology, beginning with Goal Attainment Scaling (GAS), been used in healthcare and educational settings since 1968. Numerous studies have found GAS to be highly sensitive to change, unlike other measures that use a generic and broad evaluation, not specific to the needs of each individual. The ability to capture small but meaningful change over time makes it a preferred outcome measure among clinicians, researchers, teachers, and caregivers.','1',NULL,1,'2020-04-20 18:36:20','2020-06-15 13:40:08',NULL),(2,'welcome_heading','Welcome to Goal Scaling Solutions!','1',NULL,1,'2020-04-20 18:36:20','2020-06-15 13:40:08',NULL),(3,'about_us_content','Drs. Ann Chapleau, DHS, OTR/L and Jennifer Harrison, PhD, LMSW, CAADC, faculty colleagues at Western Michigan University, founded Goal Scaling Solutions (GSS) in 2015 to provide a more user-friendly digital tool for outcome measurement using goal attainment scaling methodology. Amy S. Courter, MBA joined our GSS team in 2020 as CEO to guide our technology development and commercialization process. We provide these tools and services for health and wellness, education and athletics, and business and organizations. Our work has been funded through the Health Resources and Services Administration, the Sammons Center for Innovation, and the WMU Technology Development Fund.','1',NULL,1,'2020-04-20 18:36:36','2020-05-05 22:44:24',NULL),(4,'about_us_heading','About Us','1',NULL,1,'2020-04-20 18:36:36','2020-04-20 18:36:41',NULL),(5,'about_us_image_content','Ann Chapleau & Jennifer Harrison','1',NULL,1,'2020-04-20 18:36:36','2020-04-20 18:36:56',NULL),(6,'about_us_image','1588639445_Chapleau Ann Harrison Jennifer.jpg','1',NULL,1,'2020-04-20 18:37:11','2020-05-05 04:44:05',NULL);
/*!40000 ALTER TABLE `site_content` ENABLE KEYS */;
UNLOCK TABLES;

