DROP TABLE IF EXISTS `user_details`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_details` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `gender` enum('M','F','O') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'M => Male, F =>\n            Female, O => Other',
  `user_id` bigint(20) unsigned NOT NULL,
  `dob` datetime DEFAULT NULL,
  `program_id` bigint(20) unsigned DEFAULT NULL,
  `provider_id` bigint(20) unsigned DEFAULT NULL,
  `provider_type_id` bigint(20) unsigned DEFAULT NULL,
  `num_users` int(11) DEFAULT NULL,
  `num_providers` int(11) DEFAULT NULL,
  `num_goals` int(11) DEFAULT NULL,
  `num_users_goals` int(11) DEFAULT NULL,
  `avg_goal_change` float DEFAULT NULL,
  `created_by` bigint(20) unsigned DEFAULT NULL,
  `last_modified_by` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_details_dob_index` (`dob`) USING BTREE,
  KEY `user_details_avg_goal_change_index` (`avg_goal_change`) USING BTREE,
  KEY `user_details_num_goals_index` (`num_goals`) USING BTREE,
  KEY `user_details_num_users_goals_index` (`num_users_goals`) USING BTREE,
  KEY `user_details_num_users_index` (`num_users`) USING BTREE,
  KEY `user_details_created_by_foreign` (`created_by`) USING BTREE,
  KEY `user_details_last_modified_by_foreign` (`last_modified_by`) USING BTREE,
  KEY `user_details_program_id_foreign` (`program_id`) USING BTREE,
  KEY `user_details_provider_id_foreign` (`provider_id`) USING BTREE,
  KEY `user_details_provider_type_id_foreign` (`provider_type_id`) USING BTREE,
  KEY `user_details_user_id_foreign` (`user_id`) USING BTREE,
  CONSTRAINT `user_details_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_details_last_modified_by_foreign` FOREIGN KEY (`last_modified_by`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_details_program_id_foreign` FOREIGN KEY (`program_id`) REFERENCES `programs` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_details_provider_id_foreign` FOREIGN KEY (`provider_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_details_provider_type_id_foreign` FOREIGN KEY (`provider_type_id`) REFERENCES `provider_types` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_details_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT;
