DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `image` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `logo_image` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `first_name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `last_name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `user_type_id` bigint(20) unsigned NOT NULL,
  `email` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `phone` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` longtext COLLATE utf8mb4_unicode_ci,
  `city` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `state_id` bigint(20) unsigned DEFAULT NULL,
  `zip` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `record_num` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `organization_id` bigint(20) unsigned DEFAULT NULL,
  `notes` longtext COLLATE utf8mb4_unicode_ci,
  `last_login` datetime DEFAULT NULL,
  `is_active` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '1' COMMENT '0=>Blocked, 1=>Active',
  `inactive_date` date DEFAULT NULL,
  `created_by` bigint(20) unsigned DEFAULT NULL,
  `last_modified_by` bigint(20) unsigned DEFAULT NULL,
  `remember_token` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `users_email_unique` (`email`) USING BTREE,
  KEY `users_first_name_index` (`first_name`) USING BTREE,
  KEY `users_last_name_index` (`last_name`) USING BTREE,
  KEY `users_email_verified_at_index` (`email_verified_at`) USING BTREE,
  KEY `users_password_index` (`password`) USING BTREE,
  KEY `users_phone_index` (`phone`) USING BTREE,
  KEY `users_city_index` (`city`) USING BTREE,
  KEY `users_zip_index` (`zip`) USING BTREE,
  KEY `users_record_num_index` (`record_num`) USING BTREE,
  KEY `users_image_index` (`image`) USING BTREE,
  KEY `users_last_login_index` (`last_login`) USING BTREE,
  KEY `users_organization_id_foreign` (`organization_id`) USING BTREE,
  KEY `users_state_id_foreign` (`state_id`) USING BTREE,
  KEY `users_user_type_id_foreign` (`user_type_id`) USING BTREE,
  CONSTRAINT `users_organization_id_foreign` FOREIGN KEY (`organization_id`) REFERENCES `organizations` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_state_id_foreign` FOREIGN KEY (`state_id`) REFERENCES `states` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `users_user_type_id_foreign` FOREIGN KEY (`user_type_id`) REFERENCES `users_types` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT;
